    @Test
    public void testSuffixArray() {
        String inputString = "AABCBAABBCC";
        int[] suffixArrray = new int[]{1, 2, 3, 2, 1, 1, 2, 2, 3, 3, 'A' - inputString.length()};
        int[] actualSuffixArray = SmallestStringFromTwoStacks.createSuffixArray(inputString);

        for (int number : suffixArrray) {
            System.out.print(number + ",");
        }
        System.out.println("");
        for (int number : actualSuffixArray) {
            System.out.print(number + ",");
        }

        assertTrue(Arrays.equals(suffixArrray, actualSuffixArray));

    }

